import styled from "@emotion/styled";
// import styled from "@emotion/styled/macro";

const MainWindow = styled.div`
  width: 1440px;
  height: 900px;
  background: #f1f4f8;
  display: flex;
  margin-left: auto;
  margin-right: auto;
`;
export default function MainPage() {
  // styles

  return <MainWindow>Main Page</MainWindow>;
}
